  const [users, setUsers] = useState([])

  useEffect(() => {
    loadData()
 }, [])

  const loadData = async() => {
    setLoading(true)
    try {
      const response = await axios('http://localhost:5000/users')
      setUsers(response.data)
      console.log(response.data)
    } catch(e) {
       console.log(e)
    } finally {
        setLoading(false)
    }
  }

